import React, { PureComponent } from "react";
import PropTypes from "prop-types";
import './Login.css'
export default class Login extends PureComponent {
  static propTypes = {
    
  };
  
  onClick = event  =>
  {
	  //do login logic from server,
	  console.log(this.password)
	  //this.props.history.push("/");
  };
  
  render() {
    return (
       <div >
          <div className='component-login' style={{display: "flex", flexDirection: "column",
            position: 'absolute', left: '25%', top: '30%',
            width: '50%'
          }}>
            <label>Name</label>
            <input type="text" placeholder="Name" ref={(c) => this.name = c} name='name' />
            <label>Password</label>
            <input type="text" placeholder="Password" ref={(c) => this.password = c} name='password' />
            <div className="component-login-button" onClick={this.onClick} >
			Login
		   </div>
          </div>
        </div>
    );
  }
}
